import React from 'react';
import Logo from './logo.js';


const Navbar = () => {
    return (
        <nav style={{fontSize: "25px"}}>
            <div style={{display: "flex", justifyContent: "space-between", alignItems: "center", padding: 0}}>
                <Logo/>

                <div style={{display: "flex", justifyContent: "space-between", alignItems: "center", width: "100%"}}>
                    <ul style={{listStyleType: "none", display: "flex", justifyContent: "space-around", flex: 0.5}}>
                        <li><a href="/">Home</a></li>
                        <li><a href="/about">About</a></li>
                        <li><a href="/events">Events</a></li>
                        <li><a href="/teams">Stats</a></li>
                    </ul>

                    <ul style={{listStyleType: "none", display: "flex", justifyContent: "space-around"}}>
                        <li><a href="/login">Login</a></li>
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
